import React from 'react'
import {
    Container,
    Dropdown,
    Image,
    Menu,
    Search,
    Icon,
  } from 'semantic-ui-react';

import {NavLink} from 'react-router-dom';

const Navbar = () => (
  <div>
    <Menu fixed='top' inverted>
      <Container>
        <Menu.Item as='a' header>
          <Image size='mini' src='/logo.png' style={{ marginRight: '1.5em' }} />
          The Sun News
        </Menu.Item>
        <NavLink to='/'> <Menu.Item as='li'>Home</Menu.Item> </NavLink>
        <NavLink to='/detail/'> <Menu.Item as='li'>detail</Menu.Item> </NavLink>

        <Menu.Menu position='right'>
        <Search
            aligned='right'
            loading={false}
            onResultSelect={none}
            onSearchChange={_.debounce(this.handleSearchChange, 500, {
              leading: true,
            })}
            results={results}
            value={value}
          />
        </Menu.Menu>

      </Container>
    </Menu>
  </div>
)

export default Navbar;
